def max_dima_name_traversals(n, m, table):
    m -= 1
    q = {'I': 0, 'M': 1, 'A': 2, 'D': 3}
    t = []
    for row in table:
        t += map(q.get, row)
        t.append(-7)
    t += [-7] * m
    p = [[] for _ in t]
    c = [0] * len(t)
    for a in range(n * m):
        for b in (a - m, a + m, a - 1, a + 1):
            if abs(t[b] - t[a] + 1) == 2:
                p[a].append(b)
                c[b] += 1
    s = [i for (i, q) in enumerate(c) if not q]
    while s:
        a = s.pop()
        for b in p[a]:
            t[b] = max(t[b], t[a] + 1)
            c[b] -= 1
            if c[b] == 0:
                s.append(b)
    k = max(t) - 2 >> 2
    if any(c):
        return 'Poor Inna!'
    elif k > 0:
        return k
    else:
        return 'Poor Dima!'

